import React from 'react';
import databases from '../../Database/test';
function Cards() {
    const data=databases.restaurants
    let modified_collection = []
    if (data.length > 0) {
        modified_collection = data.reduce((rows, key, index) => {
            return (index % 3 === 0 ? rows.push([key])
                : rows[rows.length - 1].push(key)) && rows;
        }, []);

    }
    return ( 
        <>
        <div className="row">{
 Object.keys(data).map((x)=> <div className="col bRd5"><img className='bRd5' src={data[x].photograph} alt="" /><h4></h4></div>)
            }
           </div>
           <div className="row">
                <div  style={{ width: "97%" }}>

                    {
                        modified_collection.map((row) =>
                            <div className="row carder" style={{ width: "100%" }}>
                                {row.map(col => (<div className="col" >
                                    <h3>{col.name}</h3>
                                    <h4>{`Cuisine Type: ${col.cuisine_type}`}</h4>
                                    <p>{`Neighborhood: ${col.neighborhood}`}</p>
                                </div>))}
                            </div>
                        )
                    }

                </div>
            </div>

        </>
     );
}

export default Cards;
